 beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Vzc='Dimension',plc='Dimension [height=',iwc='DirectionalTextHelper',lwc='DockLayoutPanel',mwc='DockLayoutPanel$Direction',nwc='DockLayoutPanel$Direction;',qwc='DockLayoutPanel$DockAnimateCommand',owc='DockLayoutPanel$LayoutData',usc='DomEvent',zsc='DomEvent$Type',Dyc='Double',qic='EAST',Ccc='EEE, d MMM yyyy HH:mm:ss Z',loc='EEE. dd MMM. yyyy HH:mm:ss',Wcc='EEEE, MMMM d',Fcc='EEEE, MMMM d, y',hac='EM',Xfc='EMPTY',agc='ENABLED',hec='END',jac='EX',Ruc='ElementMapperImpl',Suc='ElementMapperImpl$FreeNode',Ydc='English',Hrc='Enum',Pdc='Etc/GMT',Rdc='Etc/GMT+',Qdc='Etc/GMT-',yac='Event type',Jxc='Event$NativePreviewEvent',Msc='EventBus',Yqc='EventObject',brc='Exception',Wgc='Expecting version 6 from server, got ',tbc='F',umc='F8834F07517EF3B7D02B9E845E5E1B88',cac='FIXED',shc='FLOAT',_lc='Fail: ',Nbc='Feb',Bbc='February',Rpc='Female',Eyc='Float',rwc='FlowPanel',Rvc='FocusWidget',rkc='For input string: "',pcc='Fri',icc='Friday',Mac='GET',Coc='GGD55XLBAH',nqc='GGD55XLBAJ',Apc='GGD55XLBBI',Boc='GGD55XLBCH',Cpc='GGD55XLBCI',yfc='GGD55XLBDB',Aoc='GGD55XLBDH',wqc='GGD55XLBDJ',jpc='GGD55XLBDK',$ec='GGD55XLBEB',yoc='GGD55XLBEH',Bpc='GGD55XLBEI',oqc='GGD55XLBEJ',zfc='GGD55XLBFB',Foc='GGD55XLBFH',Zpc='GGD55XLBFI',Pqc='GGD55XLBFK',Wpc='GGD55XLBGI',Nqc='GGD55XLBGK',Cfc='GGD55XLBHB',Noc='GGD55XLBHH',Kpc='GGD55XLBHI',Mqc='GGD55XLBHK',Poc='GGD55XLBIH',Jqc='GGD55XLBIK',Ooc='GGD55XLBJH',Knc='GGD55XLBJJ',Oqc='GGD55XLBJK',$oc='GGD55XLBKG',vpc='GGD55XLBKH',$pc='GGD55XLBKI',Eqc='GGD55XLBKK',Xoc='GGD55XLBLG',upc='GGD5
